    public function pass(){
        $user = User::findOrFail(auth()->user()->id);
        return view('password', ['user' => $user]);
    }
    public function alterpass(Request $request){
        $user = User::findOrFail(auth()->user()->id);
        $senhaAtual = $request->password_atual;
        $msg = '';

        if(\Hash::check($senhaAtual, $user->password)){
            if($request->password == $request->confirm_password){
                $user->password = bcrypt($request->password);
                $user->update();
                $msg = 'Senha alterada com sucessl!';
            }else{
                $msg = 'A confirmação de senha não confere';
            }
            return redirect('/')->with('msg', $msg);
        }
            return redirect('/user/password')->with('msg', 'A senha atual não confere, verifique por favor!')->with('class', 'danger');
    }
